import React, {useState} from "react";
import axios from "axios";

export function Partner(){
    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')
    const [storeName, setName] = useState('')
    const [contactno, setPhone] = useState('')
    const [storeLoc, setLoc] = useState('')
    const [email, setEmail] = useState('')
    const submitresponse= (event) => {
        console.log(event.target.username)
        axios.post("http://localhost:9087/partner",{

            storeName,
            storeLoc,
            contactno,
            email, username, password})

            .then(response => {console.log(response)})
            .catch(error => {console.log(error)})
        event.preventDefault()

    }

    return (
        <form onSubmit={submitresponse}>
            Store Name: <input type="text"  value={storeName} onChange={(e)=>{setName(e.target.value)}}/>
            Store Location: <input type="text" value={storeLoc} onChange={(e)=>{setLoc(e.target.value)}}/>
            Phone: <input type="text" value={contactno} onChange={(e)=>{setPhone(e.target.value)}}/>
            Email: <input type="text" value={email} onChange={(e)=>{setEmail(e.target.value)}}/>
            Username: <input type="text" value={username} onChange={(e)=>{setUsername(e.target.value)}}/>
            Password: <input type="password" value={password} onChange={(e)=>{setPassword(e.target.value)}}/>
            <input type="submit" onChange={submitresponse}/>
            <h1>Hello {storeName} {storeLoc}</h1>
        </form>
    )
}
